`

function LatestReleases() {
    return (
    <section>
            <h2>LATEST RELEASES</h2>
            {book.map( books => (
            <>
                <p>{books.nome}</p>
                <img src={books.src} alt="book-img" />
            
            </>
            ))}
    </section>
    )
}

